import { UserService } from './services/user.service';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss'],
})
export class RegisterComponent implements OnInit {
  constructor(private userService: UserService) {}
  ngOnInit(): void {
    this.userService.getUsers$.subscribe((x) => {
      console.log(x);
    });
  }
}
<div class="flex h-screen">
  <div class="w-3/4 bg-slate-50 ">
    <div class="px-16   p-10">

      <h1 class="text-4xl text-blue-900 px-5 ">Welcome to <span class="fw-bold text-5xl">Matcher</span>
      </h1>
      <br>
      <h5 class="text-blue-600 my-3 px-5 ">Login for a beautiful life !</h5>
      <br>
      <h5 class="text-black px-4">Let's connect</h5>

      <img src="../../../assets/images/register-bg.svg" class="h-full  left-0">
    </div>
  </div>
  <div class="w-2/4 p-16 bg-slate-100">
    <h5 class="text-blue-600 ">Register</h5>
    <div class="my-4 px-5">
      <h1 class="text-left">Username</h1>
      <div class="bg-white">
      </div>
    </div>
  </div>
</div>
